				for (j = 0; j < N; j++) if (D[k][j] != INF) {
					d = D[i][k] + D[k][j];
					if (D[i][j] > d) D[i][j] = d;
				}
			}
		}
		for (i = 0; i < N; i++) P[i] = in();
		for (i = 0; i < N; i++) K[i] = in();

		source = N << 1, sink = source+1, V = sink+1;
		memset(hi, 0, V << 2);

		for (i = 0; i < N; i++) {
			add_edge(source, i, P[i]);
